import React from 'react';
import styled from 'styled-components';
import image from "../../image/Frame6.png"

const Sidebar = () => {
    return (
        <SidebarContainer>
            <h3>Recent Posts</h3>
            <img src={image} width={"100%"} alt="이미지"/>
            <ul>
                <li></li>
                <li><a href="#">Post 2</a></li>
                <li><a href="#">Post 3</a></li>
            </ul>
        </SidebarContainer>
    );
};

const SidebarContainer = styled.aside`
    display: table-cell;
    width: 280px;
    position: fixed;
    overflow-x: hidden;
    overflow-y: auto;
    top: 0;
    bottom: 0;
    z-index: 1;
    padding-right: 20px;
    border-right: 1px solid grey;
`;

export default Sidebar;
